{"de": "**Art. 93 BauV**

- 1. Die Ausnützungsziffer ist die Verhältniszahl zwischen der anrechenbaren Bruttogeschossfläche der Gebäude und der anrechenbaren Landfläche.

- 2. Die anrechenbare Bruttogeschossfläche ist die Summe aller dem Wohnen oder dem Gewerbe dienenden oder hierfür verwendbaren ober- und unterirdischen Geschossflächen, einschliesslich der Mauer- und Wandquerschnitte.

**Nicht angerechnet werden:**

 - zu Wohnungen gehörende Keller- und Dachräume, sofern sie nicht als Wohn- oder Arbeitsräume (Art. 63 BauV) verwendbar sind;

- eine zu einem Wohnraum gehörende Galerie im Dachraum, sofern sie keine anrechenbaren Räume erschliesst;

- Heiz-, Kohlen-, Tankräume, Räume für Energiespeicher und Waschküchen;

- Maschinenräume für Lift-, Ventilations- und Klimaanlagen;

- allen Anwohnenden, Besuchenden und Angestellten dienende Ein- oder Abstellräume für Motorfahrzeuge, Velos und Kinderwagen sowie in Mehrfamilienhäusern und Wohnsiedlungen die Gemeinschaftsräume;

- Verkehrsflächen wie Korridore, Treppen und Lifte, die ausschliesslich nicht anrechenbare Räume erschliessen, ferner bei Hauseingängen im Untergeschoss die Hauseingangszone mit Treppe zum darüberliegenden Geschoss, sofern das Untergeschoss keine Wohn- und Arbeitsräume im Sinne von Artikel 63 Bau V enthält;

- mindestens einseitig offene Dachterrassen oder Gartensitzplätze (Fassung vom 24. 6. 2009)

- offene ein- und vorspringende Balkone, sofern sie nicht als Laubengänge dienen;

- unterirdische gewerbliche Lagerräume, die weder publikumsoffen noch mit Arbeitsplätzen belegt sind;

- in Räumen mit Dachschräge die Fläche, über welcher die Raumhöhe weniger als 1, 5 m beträgt.

- 3. Die anrechenbare Landfläche ist gleich der Fläche der von der Baueingabe erfassten, baulich noch nicht ausgenützten Grundstücke oder Grundstückteile. Hinzugerechnet wird die anstossende Fläche von Detailerschliessungsstrassen, soweit sie vom Baugrundstück abparzelliert worden ist und wenn im Zeitpunkt der Baueingabe seit der Abparzellierung nicht mehr als zehn Jahre verflossen sind.

**Nicht angerechnet werden:**

 - die Fläche von Basiserschliessungsstrassen, die in einem Überbauungs- oder Strassenplan festgelegt ist oder für die der entsprechende Plan öffentlich aufgelegt worden ist;

- Wald und Gewässer;

- einer anderen Nutzungsart zugewiesene Grundstücksteile.

- Die Gemeinden können in ihren Vorschriften bestimmen, dass Grünflächen und Flächen für öffentliche Nutzungen, soweit diese der Freihaltung dienen, anzurechnen sind."}

{"de": "Als besonders sensible Bauten gelten:

- Gebäude und Anlagen, in denen sich besonders viele Personen aufhalten, die schwer zu evakuieren sind (wie Spitäler, Heime, Schulen) oder die besonderen Risiken ausgesetzt sind (z.B. Campingplätze);

- Gebäude und Anlagen, an denen bereits geringe Einwirkungen grosse Schäden zur Folge haben (wie Schalt- und Telefonzentralen, Steuerungs- und Computeranlagen, Trink-wasserversorgungen, Kläranlagen);

- Gebäude und Anlagen, an denen grosse Folgeschäden auftreten können (wie Deponien, Lagereinrichtungen oder Produktionsstätten mit Beständen an gefährlichen Stoffen)."}

{"de": "Im Kanton Bern gibt es keine separate Reklamebewilligung mehr. Reklamen unterliegen grundsätzlich der Baubewilligungspflicht und benötigen demnach ein Baugesuch. Dies gilt auch für Strassenreklamen. In der Signalisationsverordnung (SSV) schreibt das Bundesrecht vor, dass Strassenreklamen eine „Bewilligung der nach kantonalem Recht zuständigen Behörde“ brauchen. Deshalb wird in Art. 32 Abs. 2 BauG festgehalten, dass die Baubewilligung als Reklamebewilligung nach der eidgenössischen Signalisationsverordnung gilt.

[Baugesetz (BauG)](https://www.belex.sites.be.ch/frontend/versions/862)

[Dekret über das Baubewilligungsverfahren (Baubewilligungsdekret, BewD)](https://www.belex.sites.be.ch/frontend/versions/569)"}

{"de": "Bei Bauvorhaben auf lärmvorbelasteten Standorten müssen im Baugesuch

- die Lärmbelastung im offenen Fenster lärmempfindlicher Räume;

- allfällige Lärmschutzmassnahmen;

- die Schalldämmmasse der Aussenbauteile;

ausgewiesen werden (Art. 34 LSV).

Nach Art. 22 USG und Art. 31 LSV müssen die Immissionsgrenzwerte bei allen Fenstern der lärmempfindlichen Räume eingehalten sein.

[Bauen auf lärmvorbelasteten Standorten im Kanton Bern (Lärmschutznachweis, Massnahmen, Anforderungen an die Schalldämmung)](https://www.bve.be.ch/bve/de/index/umwelt/umwelt/laerm.html)"}

{"de": "Ein Betrieb gilt als öffentlich, wenn er durch Anschriften, Werbung oder ähnliches nach aussen als Gastgewerbebetrieb in Erscheinung tritt (Art. 6 GGG, Art. 4 GGV)

[Gastgewerbegesetz (GGG)](https://www.belex.sites.be.ch/frontend/versions/610)

[Gastgewerbeverordnung (GGV)](https://www.belex.sites.be.ch/frontend/versions/611)"}

{"de": "Die Öffnungszeiten müssen nur angegeben werden, wenn gegenüber der ordentlichen Polizeistunde (00.30 Uhr) eine Verlängerung gewünscht wird (Art. 11 GGG, Art. 16 GGV).

[Gastgewerbegesetz (GGG)](https://www.belex.sites.be.ch/frontend/versions/610)

