{"de": "Gebäude und Anlagen sowie bauliche oder nutzungsbezogene Änderungen an allen Bauten und Anlagen werden in eine der vier Qualitätssicherungsstufen (QSS 1 bis 4) eingeteilt. Ab QSS 2 muss der QS-Verantwortliche Brandschutz über eine Ausbildung verfügen, die von der VKF anerkannt ist.

[Infoplattform für Brandschutz](https://heureka.gvb.ch/de/startseite/)

[QSS-Logik ](/assets/downloads/eBau_QSS%20Stufen_Neu.pdf)"}

{"de": "Verkehrsintensive Vorhaben sind:

- Nutzungen mit einem Verkaufsanteil > 2‘ 500m2 Grundfläche (bestehend und neu zusammen);

- Grosse Vorhaben nach Art. 53 Abs. 4 BauV, welche zusätzliche Abstellplätze zum Grundbedarf auslösen."}

{"de": "1\. Der Brandschutzabstand ist so festzulegen, dass Bauten und Anlagen nicht durch gegenseitige Brandübertragung gefährdet sind. Bauart, Lage, Ausdehnung und Nutzung sind zu berücksichtigen.

2\. Es sind folgende Brandschutzabstände zwischen benachbarten Bauten und Anlagen einzuhalten:

- 5 m, wenn die äusserste Schicht beider Aussenwandkonstruktionen aus Baustoffen der RF1 besteht;

- 7.5 m, wenn die äusserste Schicht einer der beiden Aussenwandkonstruktionen aus brennbaren Baustoffen besteht;

- 10 m, wenn die äusserste Schicht beider Aussenwandkonstruktionen aus brennbaren Baustoffen besteht.

3\. Die Brandschutzabstände dürfen reduziert werden:

- zwischen Einfamilienhäusern;

- zwischen Gebäuden geringer Höhe;

- zwischen Gebäuden mittlerer Höhe, wenn die Aussenwände, mit Ausnahme von zu öffnenden Fenstern und Türen, einen Feuerwiderstand von mindestens 30 Minuten aufweisen.

Die reduzierten Brandschutzabstände betragen mindestens:

- 4 m, wenn die äusserste Schicht beider Aussenwandkonstruktionen aus Baustoffen der RF1 besteht;

- 5 m, wenn die äusserste Schicht einer der beiden Aussenwandkonstruktionen aus brennbaren Baustoffen besteht;

- 6 m, wenn die äusserste Schicht beider Aussenwandkonstruktionen aus brennbaren Baustoffen besteht. 

4\. Brennbare Anteile der Aussenwandflächen oder vorspringende Teile von Bauten und Anlagen wie Balkone, Dachvorsprünge und Wintergärten sind entsprechend zu berücksichtigen. Dachuntersichten sind davon ausgenommen."}

{"de": "Bei komplexen Ausgangslagen empfiehlt es sich, die baurechtlichen Rahmenbedingungen mit einer Vorabklärung zu prüfen, bevor hohe Planungskosten entstehen.  

Für komplizierte und komplexe Bauvorhaben oder bei unklarer Rechtslage ist es empfehlenswert, vor Eingabe eines Baugesuchs bei der zuständigen Gemeinde eine schriftliche Vorabklärung mit konkreten Fragen einzureichen. Aufgrund der Auskunft können Sie die Chancen und Risiken eines Bauvorhabens besser einschätzen und unnötige Verzögerungen und Mehrkosten im Baubewilligungsverfahren vermeiden. Eine Vorabklärung ist in der Regel kostenpflichtig.  

Es besteht die Möglichkeit einzelne Fragen durch eine "Einfache Vorabklärung" zu beantworten oder eine umfassende Beurteilung des Bauvorhabens durch eine "Vollständige Vorabklärung" durchzuführen. Die bereits ausgefüllten Angaben können bei einer "Vollständigen Vorabklärung" in das Baugesuch überführt werden."}
